import './App.css';
import { Route, Routes } from 'react-router-dom';
import React from 'react';

import Post from './post/PagePost';
import Read from './post/PageLoad';
import Category from './post/PageCategory';


function App() { 
  return (
    <div className="App">
      <div id="Box2" style={{ width: '20%' }}>
          <Category />
        </div>
        <div id="root" style={{ width: '80%' }}>
          <Switch>
            <Route path="/blog/:categoryName" component={Post} />
          </Switch>
        </div>
    </div> 
  ); 
}


function Home() {

  return (
    <div>
      <br></br>
      <br></br>
      <h1>블로그의 홈 - 나를 소개합니다.</h1>
      <p>블로그 카테고리 글 선택 전의 홈</p>
      <a>게임개발의 끝을 마치긴 해야 함.</a>
      <Post/>
    </div>
    
  );
}

export default App;
